import PropTypes from "prop-types";

import { Carousel } from "../../../../components";
import { IoArrowBackCircleSharp } from "react-icons/io5";
import "./SelectDay.scss";

export const SelectDay = ({
  program,
  next,
  prev,
  step,
  setSelectedProgram,
}) => {
  console.log(program, next, prev, step);
  const { days } = program;
  return (
    <div className="d-block pt-5">
      <div onClick={() => prev()} className="text-start back-hover">
        <IoArrowBackCircleSharp color="#EBAA28" size={28} />
      </div>
      <h2 className="fw-bold pb-2"> Select Day </h2>
      <h3 className="fw-bold pb-4 yellow">{program.name}</h3>
      <br />
      <Carousel>
        {days.map((day) => {
          return (
            <div className="d-flex justify-content-center" key={day.id}>
              {day.id}
            </div>
          );
        })}
      </Carousel>
    </div>
  );
};

SelectDay.propTypes = {
  program: PropTypes.object,
  next: PropTypes.func,
  prev: PropTypes.func,
  step: PropTypes.number,
};
